import "./Item.css";
import Date_comp from "./Date";

function Item(props) {
  return (
    <div>
      <div className="item">
        <Date_comp date={props.date}></Date_comp> {/* multi-Component */}
        <p className="name">{props.name}</p>
        <p className="price">${props.price}</p>
        <button className="cancle" onClick={props.clear()}>
          X
        </button>
      </div>
      <br />
    </div>
  );
}
export default Item;
